import React from 'react';
import { BrowserRouter as Router, Route, Redirect} from 'react-router-dom';

import Login from './login-signup/pages/login';

function App() {
  return <Router>
    <Route path="/" exact>
      <Login />
    </Route>
    <Redirect to="/" /> 
  </Router>;
}

export default App;
